		<script>
			//Event Listeners
			
			// Clears Notepad	
			var clearNPBTN = document.getElementById('clrnp');
			clearNPBTN.addEventListener('click', function(){
				document.getElementById('notepad').value = "";
			});

			// Obfuscates Notepad by adding blackout to class
			var obfBTN = document.getElementById('obf');
			var notepad = document.getElementById('notepad');
			obfBTN.addEventListener('click', function(){
				notepad.classList.add('blackout');	
			});

			//removes Notepad Obfuscation on dblclick
			notepad.addEventListener('dblclick', function(){
				notepad.classList.remove('blackout');
			});

			//Finds the date x days ago
			var dbtn = document.getElementById('datebtn');
			dbtn.addEventListener('click', function(){
				document.getElementById('date').value = getDate();
			});

			//Makes Bollinger Band Chart
			var makeBBChart = document.getElementById('makebb');
			makeBBChart.addEventListener('click', function(){
				makeBB();
			});

			//Make RSI Chart
			var makeRSIChart = document.getElementById('makersi');
			makeRSIChart.addEventListener('click', function(){
				makeRSI();
			});

			// Makes a Moving Average Chart
			var makeMAChart = document.getElementById('makema');
			makeMAChart.addEventListener('click', function(){
				makeMA(document.getElementById('analysisData').value)
			});


			function clearTextArea(name){
				let tatbc = document.getElementById(name);
				tatbc.value = "";
			}

			function searchInvp(){
				let queryName = document.getElementById('searchinvestopedia').value;
				clearTextArea('searchinvestopedia');
				window.open('https://www.investopedia.com/search?q=' + queryName);
			}


			//print to stock data area
			function printToSDA(item){
				//Write call results to textinput
				let res = item.results;
			       	let contents = document.getElementById('textinput').value;
				for(i=0; i<res.length; i++){
					//console.log(res[i]);
					for(let info in res[i]){
						//console.log(res[i][info]);
						let newline = info + ": " + res[i][info] + "\n";
						document.getElementById('textinput').value += newline;
					}
					// add whitespace for readability
					document.getElementById('textinput').value += "\n"
				}
			}

			//print JSON instead
			function returnJSON(item){
				document.getElementById('textinput').value = JSON.stringify(item["results"]);
			}

			//Call Polygon.io API for stock data
			function callPolygon(){
				//Can make 5 requests per minute due to API free dev plan constraints
				let s1 = document.getElementById('sd1').value;
				var q = s1;
				var checkboxChecked = document.getElementById('checkPolyJson');
				//console.log(q);
				clearTextArea('textinput');
				if(checkboxChecked.checked) {
					// Print as a JSON object
					fetch(q).then(response => response.json()).then(data => returnJSON(data)).catch(error => console.error(error));
				} else {
					// Otherwise print as strings
					fetch(q).then(response => response.json()).then(data => printToSDA(data)).catch(error => console.error(error));
				}
			}

			
			// checks for single JSON news article or collection
			function newsAPIJSON(){
				//Parse then check for multiple articles
				let jsonItem = document.getElementById('jsoninput').value;
				jsonItem = JSON.parse(jsonItem);
				//Clear text area
				clearTextArea('jsoninput');
				if(Array.isArray(jsonItem)){
					for(let i = 0; i < jsonItem.length; i++){
						let finalResult = jsonItem[i];
						console.log(finalResult);
						let finRes = finalResult["title"] + ": " + "\n" + finalResult["content"] + "\n" + " ||URL: " + finalResult["url"] + "\n";
						document.getElementById('jsoninput').value += finRes + "\n";
					}
				} else {
					//Otherwise, it's a single JSON object
					let finalResult = jsonItem["title"] + ": " + "\n" + jsonItem["content"] + "\n" + " ||URL: " + jsonItem["url"];
					document.getElementById('jsoninput').value = finalResult;
				}
			}

			//find date
			function getDate(){
				var numDaysAgo = document.getElementById('date').value;
				var daysAgoNum = Number(numDaysAgo);
				clearTextArea('date');
				var todaysDate = new Date();
				todaysDate.setDate(todaysDate.getDate() - daysAgoNum);	
				//console.log(todaysDate);
				return todaysDate;
			}

			// Following functions use Chart.js to assist
			// in visually analyzing stocks
			// Takes in JSON data 
			function makeBB(){
				//Get JSON string and parse
				let values = document.getElementById('analysisData').value;
				values = JSON.parse(values);
				//Calcuate SMA
				const xvals = [];
				const yvals = [];
				const smaArray = [];
				const period = 20;

				for (i = 0; i < values.length; i++){
					xvals.push(values[i]['c']);
				}

				console.log(smaArray);

				//now calculate 20 day SMA
				for(let i = period - 1; i < xvals.length; i++){
					let sum = 0;
					for(let j = i; j > i - period; j--){
						sum += xvals[j];
					}

					let sma = sum / period;
					smaArray.push(sma);
				}
				
				console.log(smaArray);

				const standDev = math.std(smaArray.slice(period - 1));
				const upperBand = smaArray + 2 * standDev;
				const lowerBand = smaArray - 2 * standDev;

				//let results = { smaArray, upperBand, lowerBand };
				
				bbchart.style.backgroundColor = 'white';
				new Chart("bbchart", {
					type: "line",
                                        data: {
                                        	labels: xvals,
                                                datasets: [{
                                                	label: "Closing Prices",
                                                        backgroundColor:"rgba(0,0,255,1.0)",
                                                        borderColor: "rgba(0,0,255,0.5)",
                                                        data: xvals,
                                                        fill: false
							},

							{
							label: "SMA",
							backgroundColor:"rgba(0,0,255,1.0)",
							borderColor: "rgba(0,0,255,0.5)",
							data: smaArray,
							fill: false
							},
							{
							label: "Upper Band",
							backgroundColor:"gray",
							borderColor: "gray",
							data: upperBand,
							fill: false
							},
							{
							label: "Lower Band",
							backgroundColor:"gray",
							borderColor: "gray",
							data: lowerBand,
							fill: false
							},
						]
                                         },
                                         options:{
                                         }
                                });

			}

			function makeRSI(){
				let data = JSON.parse(document.getElementById('analysisData').value);
				//console.log(data);
				const xvals = [];
				const yvals = [];
				const priceChanges = [];
				const gains = [];
				const losses = [];
				const period = data.length;
				//console.log(period);

				for(i=0; i<data.length; i++){
					yvals.push(data[i]['c']);
					xvals.push(i);
					console.log(yvals);

					for(j=0; j<yvals.length; j++){
						priceChanges.push(yvals[j + 1] - yvals[j]);
					}
					console.log(priceChanges.length);
					console.log(priceChanges);

					for(k=0; k<priceChanges.length; k++){
						if(priceChanges[k] > 0){
							gains.push(priceChanges[k]);
						} else if(priceChanges[k] < 0){
							losses.push(priceChanges[k]);
						}
					}

					console.log(gains);
					console.log(losses);

					let sumGains = 0;
					let sumLosses = 0;
					for(l=0; l<gains.length; l++){
						sumGains += gains[l];
					}

					for(m=0; m<losses.length; m++){
						sumLosses += losses[m];
					}

					console.log(sumGains);
					console.log(sumLosses);

					let avgGains = sumGains / gains.length;
					let avgLosses = sumLosses / losses.length;
					console.log(avgGains);
					console.log(avgLosses);

					let rs = avgGains / avgLosses;
					console.log(rs);

					let rsi = 100 - (100 / (1 + rs));
					console.log(rsi);

					yvals[i] += rsi;
				}
					
				rsichart.style.backgroundColor = 'white';
                                        new Chart("rsichart", {
                                                type: "line",
                                                data: {
                                                        labels: xvals,
                                                        datasets: [{
                                                                label: "Relative Strength Index Chart",
                                                                backgroundColor:"rgba(0,0,255,1.0)",
                                                                borderColor: "rgba(0,0,255,0.5)",
                                                                data: yvals,
                                                                fill: false
                                                        }]
                                                },
                                                options:{
                                                }
                                        });


			}

			function makeMA(values){
				//Turn string into JSON
				vals = JSON.parse(values);
				var xvals = [];
				var yvals = [];
				//Check if SMA or EMA is selected
				let smaCheckbox = document.getElementById('sma');
				let emaCheckbox = document.getElementById('ema');
				if(smaCheckbox.checked){
					//calculate SMA
					const smaArray = [];
					for(i=0;i<vals.length;i++){
						//console.log(vals[i]["c"]);
						xvals.push(i);
						yvals.push(vals[i]["c"]);
					}
					const period = 20;
					console.log(period);
					for(let i=period-1; i<yvals.length; i++){
						let sum = 0;
						for(let j=i; j > i - period; j--){
							sum += yvals[j];
						}
						let sma = sum / period;
						smaArray.push(sma);
					}	
					machart.style.backgroundColor = 'white';
					new Chart("machart", {
  						type: "line",
  						data: {
    							labels: xvals,
							datasets: [{
								label: "Simple Moving Average",
      								backgroundColor:"rgba(0,0,255,1.0)",
      								borderColor: "rgba(0,0,255,0.5)",
								data: smaArray,
								fill: false
    							}]
  						},
						options:{
						}
					});
				} else if(emaCheckbox.checked){
					//calculate EMA
					const emaArray = [];
					const emaArray2 = [];
                                        for(i=0;i<vals.length;i++){
                                                //console.log(vals[i]["c"]);
                                                xvals.push(i);
                                                yvals.push(vals[i]["c"]);
					}
					const period = 20;
					const smoothFactor = 2 / (period + 1);
                                        console.log(period);
                                        for(let i=period-1; i<yvals.length; i++){
                                                let sum = 0;
                                                for(let j=i; j > i - period; j--){
                                                        sum += yvals[j];
						}
						//Calculate sma, push to array
                                                let sma = sum / period;
                                                emaArray.push(sma);
                                        }
					//Now modify MA with weights
					for(let j=0; j < emaArray.length; j++){
						//modify value at index j
						// May need to check math is correct
						emaArray2.push(emaArray[j] * smoothFactor + (1 - smoothFactor) * emaArray[j - period]);
					}
                                        machart.style.backgroundColor = 'white';
                                        new Chart("machart", {
                                                type: "line",
                                                data: {
                                                        labels: xvals,
							datasets: [{
								label: "Exponential Moving Average",
                                                                backgroundColor:"rgba(0,0,255,1.0)",
                                                                borderColor: "rgba(0,0,255,0.5)",
								data: emaArray2,
								fill: false
                                                        }]
                                                },
                                                options:{
                                                }
                                        });
				} else {
					console.error("No checkbox selected");
				}
			}

			//Patrick Bateman Mode
			function pbmmode(){
				let value = document.getElementById('mrbateman').className;
				console.log(value);
				if(value == "d-none"){
